import * as React from 'react';
import ScreenLayout from '../../layouts/ScreenLayout';
import ProfileForm from '../../components/ProfileForm/index';

const ProfileScreen = () => {
    return <ScreenLayout>
        <ProfileForm/>
    </ScreenLayout>
}
export default ProfileScreen;
